Stefy - Chelsea (Sebastien Leger Remix 2007) [Electro House]


Switching up the flavour for today to some very sophisticated production on the Electro Pop / House side of things, here is one of a few Sebastien Leger remixes that I continue to enjoy...


There is no discogs entry for this release as yet...


Label: Dinky
Catalogue Number: DINKYCD125


Released: November 24th 2007


Stefy - Chelsea (Sebastien Leger Remix) [6:31]


14.9MB

320KBps Digital Release.



Another lovely bit of production by Leger... he knows exactly what he&amp;#039;s doing when it comes to adaptation and stylisation of original works.  Don&amp;#039;t forget to check for my previous post of his outstanding remix of &quot;Larry Tee Ft. Princess Superstar - Licky (Work It Out)&quot;.


&quot; Leger started out making bigroom house for Defected but over the years he&amp;#039;s happily flitted been house, progressive, tech house, techno and electrohouse with 12&quot;s for labels such as Hed Kandi, Pryda Friends, Intec and Pickadoll, as well as poppy rerubs of Justin Timberlake, Dave Gahan and Duran Duran. &quot;


